  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains data from the capture
  and recapture of over 1500 male California sea lions (Zalophus californianus) from
  Washington between 1989-2006. The data fields include capture data such as time,
  location, weight, length, and girth for each animal captured. The dataset also includes
  records of resights of each animal from records collected from observers from California
  to Vancouver Island, British Columbia, Canada. The dataset also contains information
  from opportunistic captures of Steller sea lions (Eumetopias jubatus) in the same
  region.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
